import React, { Component } from 'react';
import base from '../../config/api.js';
let api = base.api();


class View extends Component {
    constructor(props) {
        super(props);
        this.state = {
            message: ""
        };
    }
    render() {
        return (
            <article>
                <h1>View All Data</h1>
            </article>
        );
    }
}

export default View;
